def decodeMessage(msg):
	decoded = ''
	bytes = splitTwoByTwo(msg.upper())
	print(bytes)
	for byte in bytes:
		decoded += str(decode16(byte))
		
	print(decoded)
	return decoded
			
	
def readFile(input):
	with open(input) as f:
		while True:
			c = f.read(1)
			if not c:
				print("End of file")
				break
			print("Read a character:",c, encode16(c))
			print(decode16(encode16(c)))
			
			

def encode16(c):
	return base64.b16encode(c.encode('ascii'))

def decode16(c):
	return str(base64.b16decode(c.encode('utf-8')))
	
def carry_around_add(a, b):
    c = a + b
    return(c &0xffff)+(c >>16)

def checksum(msg):
    s =0
    for i in range(0, len(msg),2):
        w =(msg[i])+((msg[i+1])<<8)
        s = carry_around_add(s, w)
    return~s &0xffff
	
def splitTwoByTwo(val):
	args = [iter(val)] * 2
	return [''.join(k) for k in zip_longest(*args)]


def ones_comp_add16(num1,num2):
	MOD = 1 << 16
	result = num1 + num2
	print(MOD)
	return result if result < MOD else (result+1) % MOD
	
